import RoomsTypeData from "./data/RoomsTypeData"

export default function RoomsType(){
    return(
        <div>
            <section className="Roomstype gallery container flex">
                <div className="Card bg-">
                    {
                        RoomsTypeData.map((value) => {
                            return(
                                <div className="w-[400px] h-[200px] bg-white text-center">
                                    {value.type}
                                </div>
                            )
                        })
                    }
                </div>
            </section>
        </div>
    )
}
